staticBinding.value:
function removeClusterNames{

    param(
        [string[]]$clusterNameList
    )

    echo "Received Cluster Names: $clusterNameList"
    echo "---"
    echo "Removing all Cluster Names..."

    # Install AD PowerShell CmdLet if not already done
    Import-Module ServerManager
    If ((Get-WindowsFeature RSAT-AD-PowerShell).Installed -ne $TRUE){
       Add-WindowsFeature RSAT-AD-PowerShell
       Start-Sleep -s 5
    }

    Foreach($clusterName in $clusterNameList){
        Try{
            $DN = "CN=$clusterName,$strDomainOU"
            $clusterObj = Get-ADObject -Filter {distinguishedName -eq $DN} -Credential $objCredential

			if($clusterObj){
				echo "Removing $clusterObj..."
				Remove-ADObject $clusterObj -Credential $objCredential -Confirm:$False
			}else{
                echo "Cluster Name $clusterName could not be found in Active Directory"
			}

        }Catch{
            $ErrorMessage = $_.Exception.Message
		    $FailedItem = $_.Exception.ItemName
		    echo "Unable to remove cluster object $clusterObj - $ErrorMessage, $FailedItem"
		    exit 1;
        }
    }
    exit 0;
}

$strDomainOU = CMD.EXE /C "$strSysDrive\Program Files\Opsware\agent_tools\get_cust_attr.bat" windows_domainou

# Create Service Account Credential
$strPassword = ConvertTo-SecureString '${svcAccPassword}' -AsPlainText -Force
$objCredential = New-Object System.Management.Automation.PSCredential ("${svcAccUsername}", $strPassword)

$clusterNameList = (${clusterNameListQuoted});

removeClusterNames -clusterNameList $clusterNameList
